function VBObox0() { // Grid Box
    // Vertex shader
    this.VERT_SRC =	
    'precision highp float;\n' +
    'uniform mat4 u_ModelMatrix;\n' +
    'attribute vec4 a_Pos;\n' +
    'attribute vec3 a_Color;\n'+
    'varying vec3 v_Colr;\n' +
    'void main() {\n' +
    '  gl_Position = u_ModelMatrix * a_Pos;\n' +
    '	 v_Colr = a_Color;\n' +
    ' }\n';
  
    // Fragment shader
      this.FRAG_SRC =
    'precision mediump float;\n' +
    'varying vec3 v_Colr;\n' +
    'void main() {\n' +
    '  gl_FragColor = vec4(v_Colr, 1.0);\n' + 
    '}\n';
  
    var floatsPerVertex = 7;
  
    // Create grid vertices
    var xcount = 100;			// # of lines to draw in x,y to make the grid.
      var ycount = 100;		
      var xymax	= 100.0;
       var xColr = new Float32Array([1.0, 1.0, 0.3]);	// bright yellow
       var yColr = new Float32Array([0.5, 1.0, 0.5]);	// bright green.
       
      gndVerts = new Float32Array(floatsPerVertex*2*(xcount+ycount));
                
      var xgap = xymax/(xcount-1);
      var ygap = xymax/(ycount-1);
  
      for(v=0, j=0; v<2*xcount; v++, j+= floatsPerVertex) {
        if(v%2==0) {
          gndVerts[j  ] = -xymax + (v  )*xgap;
          gndVerts[j+1] = -xymax;	
          gndVerts[j+2] = 0.0;	
          gndVerts[j+3] = 1.0;	
        }
        else {	
          gndVerts[j  ] = -xymax + (v-1)*xgap;
          gndVerts[j+1] = xymax;
          gndVerts[j+2] = 0.0;	
          gndVerts[j+3] = 1.0;
        }
        gndVerts[j+4] = xColr[0];	
        gndVerts[j+5] = xColr[1];	
        gndVerts[j+6] = xColr[2];
      }
   
      for(v=0; v<2*ycount; v++, j+= floatsPerVertex) {
        if(v%2==0) {		
          gndVerts[j  ] = -xymax;							
          gndVerts[j+1] = -xymax + (v  )*ygap;	
          gndVerts[j+2] = 0.0;								
          gndVerts[j+3] = 1.0;						
        }
        else {	
          gndVerts[j  ] = xymax;							
          gndVerts[j+1] = -xymax + (v-1)*ygap;
          gndVerts[j+2] = 0.0;								
          gndVerts[j+3] = 1.0;					
        }
        gndVerts[j+4] = yColr[0];	
        gndVerts[j+5] = yColr[1];	
        gndVerts[j+6] = yColr[2];	
      }
  
       this.vboContents = gndVerts;
     var mySiz = gndVerts.length;
     
     this.vboVerts = mySiz/7;
       this.FSIZE = this.vboContents.BYTES_PER_ELEMENT;
     this.vboBytes = this.vboContents.length * this.FSIZE;               
       this.vboStride = this.vboBytes / this.vboVerts; 
  
     this.vboFcount_a_Pos =  4;
     this.vboFcount_a_Color = 3;
  
     console.assert((this.vboFcount_a_Pos + this.vboFcount_a_Color) * this.FSIZE == this.vboStride,
                    "Uh oh! VBObox0.vboStride disagrees with attribute-size values!");
  
       this.vboOffset_a_Pos = 0; 
     this.vboOffset_a_Color = this.vboFcount_a_Pos * this.FSIZE;    
                      
       this.vboLoc;	
       this.shaderLoc;
  
       this.a_PosLoc;	
       this.a_ColorLoc;	
  
       this.ModelMatrix = new Matrix4();
       this.u_ModelMatLoc;
  }
  VBObox0.prototype.init = function() {
      this.shaderLoc = createProgram(gl, this.VERT_SRC, this.FRAG_SRC);
      if (!this.shaderLoc) {
      console.log(this.constructor.name + 
                              '.init() failed to create executable Shaders on the GPU. Bye!');
      return;
    }
  
      gl.program = this.shaderLoc;
  
      this.vboLoc = gl.createBuffer();	
    if (!this.vboLoc) {
      console.log(this.constructor.name + 
                              '.init() failed to create VBO in GPU. Bye!'); 
      return;
    }
   
    gl.bindBuffer(gl.ARRAY_BUFFER,	   
                                    this.vboLoc);		
  
    gl.bufferData(gl.ARRAY_BUFFER, 			  
                                        this.vboContents, 
                                     gl.STATIC_DRAW);
  
    this.a_PosLoc = gl.getAttribLocation(this.shaderLoc, 'a_Pos');
    if(this.a_PosLoc < 0) {
      console.log(this.constructor.name + 
                              '.init() Failed to get GPU location of attribute a_Pos');
      return -1;
    }
       this.a_ColorLoc = gl.getAttribLocation(this.shaderLoc, 'a_Color');
    if(this.a_ColorLoc < 0) {
      console.log(this.constructor.name + 
                              '.init() failed to get the GPU location of attribute a_Color');
      return -1;	
    }
    
      this.u_ModelMatLoc = gl.getUniformLocation(this.shaderLoc, 'u_ModelMatrix');
    if (!this.u_ModelMatLoc) { 
      console.log(this.constructor.name + 
                              '.init() failed to get GPU location for u_ModelMatrix uniform');
      return;
    }  
  }
  VBObox0.prototype.switchToMe = function() {
    gl.useProgram(this.shaderLoc);	
  
      gl.bindBuffer(gl.ARRAY_BUFFER,
                                          this.vboLoc);		
  
    gl.vertexAttribPointer(
          this.a_PosLoc,
          this.vboFcount_a_Pos,
          gl.FLOAT,		
          false,		
  
          this.vboStride,
          this.vboOffset_a_Pos);						
    gl.vertexAttribPointer(this.a_ColorLoc, this.vboFcount_a_Color, gl.FLOAT, false, this.vboStride, this.vboOffset_a_Color);
                                
    gl.enableVertexAttribArray(this.a_PosLoc);
    gl.enableVertexAttribArray(this.a_ColorLoc);
  }
  VBObox0.prototype.isReady = function() {
  var isOK = true;
  
    if(gl.getParameter(gl.CURRENT_PROGRAM) != this.shaderLoc)  {
      console.log(this.constructor.name + '.isReady() false: shader program at this.shaderLoc not in use!');
      isOK = false;
    }
    if(gl.getParameter(gl.ARRAY_BUFFER_BINDING) != this.vboLoc) {
        console.log(this.constructor.name + '.isReady() false: vbo at this.vboLoc not in use!');
      isOK = false;
    }
    return isOK;
  }
  VBObox0.prototype.adjust = function() {
    if(this.isReady()==false) {
          console.log('ERROR! before' + this.constructor.name + 
                            '.adjust() call you needed to call this.switchToMe()!!');
    }  
  
          this.ModelMatrix.setIdentity();
    this.ModelMatrix.set(g_worldMat);
  
    gl.uniformMatrix4fv(this.u_ModelMatLoc,	
                                            false, 
                                            this.ModelMatrix.elements);
  }
  VBObox0.prototype.draw = function() {
    if(this.isReady()==false) {
          console.log('ERROR! before' + this.constructor.name + 
                            '.draw() call you needed to call this.switchToMe()!!');
    }  
    
    gl.drawArrays(gl.LINES, 0, this.vboVerts);
  }
  VBObox0.prototype.reload = function() {
   gl.bufferSubData(gl.ARRAY_BUFFER, 0, this.vboContents); 
  
  }
  
  
