    this.eyePosWorld = new Float32Array(3);
    this.u_eyePosWorldLoc;
    
    this.lamp0 = new LightsT();
  
    this.matlSel= MATL_COPPER_SHINY;	
    this.matl0 = new Material(this.matlSel);
  
    this.u_lightOnLoc;
    this.u_lightTypeLoc;
