  VBObox6.prototype.init = function() {
    this.shaderLoc = createProgram(gl, this.VERT_SRC, this.FRAG_SRC);
    if (!this.shaderLoc) {
      console.log(this.constructor.name + 
                  '.init() failed to create executable Shaders on the GPU. Bye!');
      return;
    }
    
    gl.program = this.shaderLoc;	
  
    this.vboLoc = gl.createBuffer();	
    if (!this.vboLoc) {
      console.log(this.constructor.name + 
                  '.init() failed to create VBO in GPU. Bye!'); 
      return;
    }
      
    gl.bindBuffer(gl.ARRAY_BUFFER, this.vboLoc);           
    gl.bufferData(gl.ARRAY_BUFFER, this.vboContents, gl.STATIC_DRAW);
                  
    this.a_PositionLoc = gl.getAttribLocation(this.shaderLoc, 'a_Position');
    if(this.a_PositionLoc < 0) {
      console.log(this.constructor.name + 
                  '.init() Failed to get GPU location of attribute a_Position');
      return -1;
    }
  
    this.a_NormalLoc = gl.getAttribLocation(this.shaderLoc, 'a_Normal');
    if(this.a_NormalLoc < 0) {
      console.log(this.constructor.name + 
                  '.init() failed to get the GPU location of attribute a_Normal');
      return -1;
    }
  
    this.u_ModelMatLoc = gl.getUniformLocation(this.shaderLoc, 'u_ModelMatrix');
    if (!this.u_ModelMatLoc) { 
      console.log(this.constructor.name + 
                  '.init() failed to get GPU location for u_ModelMatrix uniform');
      return;
    }
  
    this.u_MvpMatLoc = gl.getUniformLocation(this.shaderLoc, 'u_MvpMatrix');
    if (!this.u_MvpMatLoc) { 
     console.log(this.constructor.name + 
                 '.init() failed to get GPU location for u_MvpMatrix uniform');
     return;
    }
  
    this.u_NormalMatLoc = gl.getUniformLocation(this.shaderLoc, 'u_NormalMatrix');
    if (!this.u_NormalMatLoc) { 
      console.log(this.constructor.name + 
                  '.init() failed to get GPU location for u_NormalMatrix uniform');
      return;
    }
  
    
    
    this.u_eyePosWorldLoc = gl.getUniformLocation(this.shaderLoc, 'u_eyePosWorld');
    if (!this.u_eyePosWorldLoc) { 
      console.log(this.constructor.name + 
                  '.init() failed to get GPU location for u_eyePosWorld uniform');
      return;
    }
    
    this.lamp0.u_pos  = gl.getUniformLocation(this.shaderLoc, 'u_LampSet[0].pos');	
    this.lamp0.u_ambi = gl.getUniformLocation(this.shaderLoc, 'u_LampSet[0].ambi');
    this.lamp0.u_diff = gl.getUniformLocation(this.shaderLoc, 'u_LampSet[0].diff');
    this.lamp0.u_spec = gl.getUniformLocation(this.shaderLoc, 'u_LampSet[0].spec');
    if( !this.lamp0.u_pos || !this.lamp0.u_ambi	|| !this.lamp0.u_diff || !this.lamp0.u_spec	) {
      console.log('Failed to get GPUs Lamp0 storage locations');
      return;
    }
    
    this.matl0.uLoc_Ke = gl.getUniformLocation(this.shaderLoc, 'u_MatlSet[0].emit');
    this.matl0.uLoc_Ka = gl.getUniformLocation(this.shaderLoc, 'u_MatlSet[0].ambi');
    this.matl0.uLoc_Kd = gl.getUniformLocation(this.shaderLoc, 'u_MatlSet[0].diff');
    this.matl0.uLoc_Ks = gl.getUniformLocation(this.shaderLoc, 'u_MatlSet[0].spec');
    this.matl0.uLoc_Kshiny = gl.getUniformLocation(this.shaderLoc, 'u_MatlSet[0].shiny');
    if(!this.matl0.uLoc_Ke || !this.matl0.uLoc_Ka || !this.matl0.uLoc_Kd || !this.matl0.uLoc_Ks || !this.matl0.uLoc_Kshiny) {
      console.log('Failed to get GPUs Reflectance storage locations');
      return;
    }
    
    this.u_lightTypeLoc = gl.getUniformLocation(this.shaderLoc, 'v_lightType');
    if(!this.u_lightTypeLoc) {
      console.log('Failed to get GPUs Light Mode storage locations');
      return;
    }
    
    this.u_lightOnLoc = gl.getUniformLocation(this.shaderLoc, 'u_lightOn');
    if(!this.u_lightOnLoc) {
      console.log('Failed to get GPUs Light Mode storage locations');
      return;
    }
  }
  VBObox6.prototype.switchToMe = function() {
    gl.useProgram(this.shaderLoc);
  
    gl.bindBuffer(gl.ARRAY_BUFFER, this.vboLoc);
   
    gl.vertexAttribPointer(this.a_PositionLoc, this.vboFcount_a_Position, 
                  gl.FLOAT, false,
                  this.vboStride, this.vboOffset_a_Position);	
  
    gl.vertexAttribPointer(this.a_NormalLoc, this.vboFcount_a_Normal, 
                  gl.FLOAT, false, 
                  this.vboStride, this.vboOffset_a_Normal);
     
    gl.enableVertexAttribArray(this.a_PositionLoc);
    gl.enableVertexAttribArray(this.a_NormalLoc);
  
    this.eyePosWorld.set([eyeX, eyeY, eyeZ]);
    this.lamp0.I_pos.elements.set( [lampx, lampy, lampz]);
    this.lamp0.I_ambi.elements.set([ambientr, ambientg, ambientb]);
    this.lamp0.I_diff.elements.set([diffuser, diffuseg, diffuseb]);
    this.lamp0.I_spec.elements.set([specularr, specularg, specularb]);
    
    gl.uniform3fv(this.lamp0.u_pos, this.lamp0.I_pos.elements.slice(0, 3));
    gl.uniform3fv(this.lamp0.u_ambi, this.lamp0.I_ambi.elements);        // ambient
    gl.uniform3fv(this.lamp0.u_diff, this.lamp0.I_diff.elements);        // diffuse
    gl.uniform3fv(this.lamp0.u_spec, this.lamp0.I_spec.elements);        // Specular
    
    gl.uniform3fv(this.matl0.uLoc_Ke, this.matl0.K_emit.slice(0, 3));                // Ke emissive
    gl.uniform3fv(this.matl0.uLoc_Ka, this.matl0.K_ambi.slice(0, 3));                // Ka ambient
    gl.uniform3fv(this.matl0.uLoc_Kd, this.matl0.K_diff.slice(0, 3));                // Kd    diffuse
    gl.uniform3fv(this.matl0.uLoc_Ks, this.matl0.K_spec.slice(0, 3));                // Ks specular
    gl.uniform1i(this.matl0.uLoc_Kshiny, parseInt(this.matl0.K_shiny, 10));     // Kshiny
    
    gl.uniform1i(this.u_lightOnLoc, lightOn);
    gl.uniform1i(this.u_lightTypeLoc, lightType);
  }
  VBObox6.prototype.isReady = function() {
    var isOK = true;
      if(gl.getParameter(gl.CURRENT_PROGRAM) != this.shaderLoc)  {
        console.log(this.constructor.name + 
                    '.isReady() false: shader program at this.shaderLoc not in use!');
        isOK = false;
      }
      if(gl.getParameter(gl.ARRAY_BUFFER_BINDING) != this.vboLoc) {
          console.log(this.constructor.name + 
                  '.isReady() false: vbo at this.vboLoc not in use!');
        isOK = false;
      }
      return isOK;
  }  
  VBObox6.prototype.adjust = function() {
    if(this.isReady()==false) {
      console.log('ERROR! before' + this.constructor.name + 
                  '.adjust() call you needed to call this.switchToMe()!!');
    }
  
    this.ModelMatrix.setIdentity();
    gl.uniformMatrix4fv(this.u_ModelMatLoc, false, this.ModelMatrix.elements);
    this.MvpMatrix.set(g_worldMat).multiply(this.ModelMatrix);
    gl.uniformMatrix4fv(this.u_MvpMatLoc, false, this.MvpMatrix.elements);
    this.NormalMatrix.setInverseOf(this.ModelMatrix);
    this.NormalMatrix.transpose();
    gl.uniformMatrix4fv(this.u_NormalMatLoc, false, this.NormalMatrix.elements);
  }
  VBObox6.prototype.draw = function() {
    if(this.isReady()==false) {
      console.log('ERROR! before' + this.constructor.name + 
              '.draw() call you needed to call this.switchToMe()!!');
    }
  
    gl.uniform3fv(this.u_eyePosWorldLoc, this.eyePosWorld);
    gl.uniform1i(this.u_lightType, lightType);
  
    for (k = 0; k < 3; k++) {
      // draw anemone
      pushMatrix(this.ModelMatrix);
      // draw torus
      this.ModelMatrix.translate(-2.1, -2 + 2.5 * k, 0);
    
      pushMatrix(this.ModelMatrix);
        this.ModelMatrix.translate(0, -0.15, 0);
        this.ModelMatrix.scale(0.55, 1, 1);
        this.ModelMatrix.rotate(90, 90, 1, 0.1);
    
        gl.uniformMatrix4fv(this.u_ModelMatLoc, false, this.ModelMatrix.elements);	
        this.MvpMatrix.set(g_worldMat).multiply(this.ModelMatrix);
        gl.uniformMatrix4fv(this.u_MvpMatLoc, false, this.MvpMatrix.elements);
        this.NormalMatrix.setInverseOf(this.ModelMatrix);
        this.NormalMatrix.transpose();
        gl.uniformMatrix4fv(this.u_NormalMatLoc, false, this.NormalMatrix.elements);
        
        gl.drawArrays(gl.TRIANGLE_STRIP, this.torStart/floatsPerVertex, this.torVerts.length/floatsPerVertex);
      this.ModelMatrix = popMatrix(); 
    
      this.ModelMatrix.scale(0.3, 0.5, 1);
    
      count = 0;
      for (i = 0; i < 11; i++) {
        pushMatrix(this.ModelMatrix);
          this.ModelMatrix.scale(0.3, 0.3, 0.15);
          this.ModelMatrix.translate(-0.4+(4 * Math.cos(30 + count)), -0.4 +(3.5 * Math.sin(30 + count)), 2.5);
    
    
        for (j = 0; j < 6; j++) {
          if (j == 0) {
            this.ModelMatrix.rotate(g_angle0now, 0, 1, 0.1);
    
            gl.uniformMatrix4fv(this.u_ModelMatLoc, false, this.ModelMatrix.elements);	
            this.MvpMatrix.set(g_worldMat).multiply(this.ModelMatrix);
            gl.uniformMatrix4fv(this.u_MvpMatLoc, false, this.MvpMatrix.elements);
            this.NormalMatrix.setInverseOf(this.ModelMatrix);
            this.NormalMatrix.transpose();
            gl.uniformMatrix4fv(this.u_NormalMatLoc, false, this.NormalMatrix.elements);
    
            gl.drawArrays(gl.TRIANGLES, this.tetraStart/floatsPerVertex, this.tetraVerts.length/floatsPerVertex);
          }
          else if (j == 2) {
            this.ModelMatrix.rotate(g_angle1now, 0, 1, 0.1);
            this.ModelMatrix.translate(0.5, 0.5, 1.0);
    
            gl.uniformMatrix4fv(this.u_ModelMatLoc, false, this.ModelMatrix.elements);	
            this.MvpMatrix.set(g_worldMat).multiply(this.ModelMatrix);
            gl.uniformMatrix4fv(this.u_MvpMatLoc, false, this.MvpMatrix.elements);
            this.NormalMatrix.setInverseOf(this.ModelMatrix);
            this.NormalMatrix.transpose();
            gl.uniformMatrix4fv(this.u_NormalMatLoc, false, this.NormalMatrix.elements);
    
            gl.drawArrays(gl.TRIANGLES, this.tetraStart/floatsPerVertex, this.tetraVerts.length/floatsPerVertex);
          }
    
          else if (j % 2 == 0 & j != 2) {
            this.ModelMatrix.translate(0.0, 0.0, 2);
            this.ModelMatrix.rotate(g_angle0now, 0, 1, 0.1);
           // this.ModelMatrix.translate(0.5, 0.5, 1.0);
    
            gl.uniformMatrix4fv(this.u_ModelMatLoc, false, this.ModelMatrix.elements);	
            this.MvpMatrix.set(g_worldMat).multiply(this.ModelMatrix);
            gl.uniformMatrix4fv(this.u_MvpMatLoc, false, this.MvpMatrix.elements);
            this.NormalMatrix.setInverseOf(this.ModelMatrix);
            this.NormalMatrix.transpose();
            gl.uniformMatrix4fv(this.u_NormalMatLoc, false, this.NormalMatrix.elements);
    
            gl.drawArrays(gl.TRIANGLES, this.tetraStart/floatsPerVertex, this.tetraVerts.length/floatsPerVertex);
          }
          else {
            this.ModelMatrix.translate(0.0, 0.0, 2);
            this.ModelMatrix.rotate(g_angle1now, 0, 1, 0.1);
           // this.ModelMatrix.translate(0.5, 0.5, 1.0);
    
            gl.uniformMatrix4fv(this.u_ModelMatLoc, false, this.ModelMatrix.elements);	
            this.MvpMatrix.set(g_worldMat).multiply(this.ModelMatrix);
            gl.uniformMatrix4fv(this.u_MvpMatLoc, false, this.MvpMatrix.elements);
            this.NormalMatrix.setInverseOf(this.ModelMatrix);
            this.NormalMatrix.transpose();
            gl.uniformMatrix4fv(this.u_NormalMatLoc, false, this.NormalMatrix.elements);
    
          gl.drawArrays(gl.TRIANGLES, this.tetraStart/floatsPerVertex, this.tetraVerts.length/floatsPerVertex);
          }
        }
        count += 20;
        this.ModelMatrix = popMatrix(); 
      }
    
    this.ModelMatrix = popMatrix(); 
    }
  }                    
  VBObox6.prototype.reload = function() {         
     gl.bufferSubData(gl.ARRAY_BUFFER, 0, this.vboContents);
  }